const CustomizedTables = ({ StyledTableRow, StyledTableCell }) => {
  return (
    <div>
      <StyledTableRow key={i}>
        <StyledTableCell component="th" scope="row">
          {row.selling_quantity}
        </StyledTableCell>
        <StyledTableCell align="left">{row.selling_amount}</StyledTableCell>
        <StyledTableCell align="left">{row.currency}</StyledTableCell>
        <StyledTableCell align="left">{row.buying_price}</StyledTableCell>
        <StyledTableCell align="left">{row.buying_quantity}</StyledTableCell>
        <StyledTableCell align="left">{row.buying_amount}</StyledTableCell>
        <StyledTableCell align="left">{row.insert_date}</StyledTableCell>
      </StyledTableRow>
    </div>
  );
};

export default CustomizedTables;
